{% form_theme registrationForm 'bootstrap_5_layout.html.twig'%}
{# {% extends 'base.html.twig' %} #}

{% block title %}Register{% endblock %}

{% block body %}
<body>
    <header>
        <h2 class=\"logo\"> Se Mi </h2>
            <nav class=\"navigation\">
            <a href=\"{{path('app_login')}}\" class=\"btnRegister-popup\">Login</a>
            </nav>
    </header>

<div class=\"container\">
   {# <form> #}
    <h1 class=\"TD\">Register</h1>
    <hr>
    {{ form_errors(registrationForm) }}

    {{ form_start(registrationForm) }}
    
        {{ form_row(registrationForm.username) }}
        {{ form_row(registrationForm.first_name) }}
        {{ form_row(registrationForm.last_name) }}
        {{ form_row(registrationForm.email) }}
        {{ form_row(registrationForm.plainPassword, {
            label: 'Password'
        }) }}
        {{ form_row(registrationForm.agreeTerms) }}
        <button type=\"submit\" class=\"btn btn-danger\">Register</button>
        <hr>
        <input type=\"button\" value=\"Clear\" onclick=\"clearForm()\" class=\"btn btn-danger\">
    {{ form_end(registrationForm) }}
</div>
</body>
{% endblock %}

{% block stylesheets %}
<link rel=\"stylesheet\" href=\"{{asset('css/bootstrap.css')}}\"/>
<link rel=\"stylesheet\" href=\"{{asset('cssK/Register.css')}}\"/>

{% endblock %}

{% block javascripts %}
<script>
    function clearForm() {
        document.querySelector(\"form\").reset();
    }
</script>
{% endblock %}", "registration/register.html.twig", "C:\\Users\\huynh\\Semi\\templates\\registration\\register.html.twig");
